style.css:
html {
  background-image: url(https://fiverr-res.cloudinary.com/images/q_auto,f_auto/gigs/274943110/original/e91151509762024323973e6a78754a6bc517d6c7/teach-you-to-use-midjourney-ai-art-generator.png);
  background-position: top center;
  background-repeat: no-repeat;
  background-size: cover;
  background-attachment: fixed;
	background-color:	#1f1f1f!important;
}
html::before,
html::after {
 	content: " ";
    height: 100%;
    width: calc((100% - (750px + 80px)) / 2);
    top: 0;
    left: 0%;
    z-index: -1;
    position: fixed;
    pointer-events: none;
	background: linear-gradient(to right,  rgba(0,0,0,0.35) 0%,rgba(0,0,0,0.44) 11%,rgba(0,0,0,0.49) 16%,rgba(0,0,0,0.61) 29%,rgba(0,0,0,0.72) 48%,rgba(0,0,0,0.85) 70%,rgba(0,0,0,0.86) 73%,rgba(0,0,0,0.95) 98%);
}
html::after {
    right: 0%!important;
    left: inherit!important;
	background: linear-gradient(to right,  rgba(0,0,0,0.95) 2%,rgba(0,0,0,0.86) 27%,rgba(0,0,0,0.85) 30%,rgba(0,0,0,0.72) 52%,rgba(0,0,0,0.61) 71%,rgba(0,0,0,0.49) 84%,rgba(0,0,0,0.44) 89%,rgba(0,0,0,0.35) 100%);
}
body {
 	background: #212930EF!important;
    background: radial-gradient(ellipse at center, rgba(64, 109, 77, 0.99) 0%, rgba(33, 41, 48, 0.98) 100%) !important;
    background: radial-gradient(ellipse at center, rgba(52, 87, 63, 0.99) 0%, rgba(26, 33, 38, 0.98) 100%) !important;
    padding-left: 40px;
    padding-right: 40px;
    padding-bottom: 30px;
    margin-bottom: 0;
}
body > ul > li {
	background: #171a1ee3;
    outline: 1px dashed #2d433e7a;
    border: 1px dotted #63978970;
    border-radius: 2px;
}
h3 {
    background: linear-gradient(to bottom, rgb(73, 89, 85) 0%,rgb(86, 104, 99) 100%)!important;
    border-bottom: 1px solid rgb(66, 87, 82);
    border-top: 1px solid rgb(66, 87, 82);
    color: rgb(182, 200, 196);
    font-size: 150%;
    margin-bottom: 20px;
    padding: 10px 18px;
    text-align: center;
    text-shadow: rgba(45, 67, 62, 0.5) 0px 1px 0px;
}
blockquote {
    font-style: italic;
    background-color: rgb(45, 67, 62);
    margin: 20px 10px;
    padding: 30px 20px 20px 20px;
    text-shadow: rgba(28, 28, 33, 0.7) 0px 1px 0px;
    position: relative;
}
blockquote::before {
    content: ',,';
    display: block;
    position: absolute;
    color: #8a8a8a;
    font-size: 40px;
    top: -28px;
    left: 13px;
    pointer-events: none;
    font-family: georgia;
    letter-spacing: -3px;
}

body > h2 {
    color: #cdd4dbad!important;
}
body > h3 {
    color: #e3e3e3!important;
}
a {
    color: #679d89!important;
}
a[href^="?ts="],
a[href^="?ts="]:hover,
a[href^="?ts="]:active {
    color: transparent!important;
    background: #212930!important;
    border: 1px dashed #679d8978!important;
    outline: 1px dotted #679d89!important;
    border-radius: 1px!important;
    box-shadow: inset 0px 0px 2px #639789!important;
}
a:hover,
a:active {
 	color: #74b39c!important;
}
* {
	color: #fefefe;
}
